@wronk that sounds good! I'd like to run a weakly supervised experiment using label maker, but I would only use label maker to classify satellite patches that have buildings and satellite patches that don't, and then use the concepts described by this paper https://research.fb.com/wp-content/uploads/2016/12/feeback-neural-network.pdf? to perform segmentation. You may want to look into it too for later, since this paper proposes better results than u-net!

- On a side note, I tried to download images via label-maker and I included my map-box access key as an environment variable. The commands ran great, but when I tried to preview the downloaded images, the file was rendered un-openable for some reason. I used the same config.json described in the example for Tanzania. Would appreciate any leads! I'm guessing it has to do with permissions on my access key?

Thanks in advance!

@Geoyi unfortunately I still am not able to preview my images. Every command runs and does what it's supposed to, but I'm unable to preview my images. I checked that upon running label-maker download and lable-maker labels, I have the necessary labels.npz file and the classification.geojson file. I am further able to confirm the validity of that file by viewing the file on geojson.io. 

- On a side note, I am running label maker on a remote linux machine with the latest tippecanoe and python 3.6.4. I tried running it on my local machine too (mac) but to no avail. Do you have a specific config.json file that has worked for you? Also, are there specific permissions I need to enable on my mapbox access token, or is it supposed to work right out of the box?

Thanks!
